import React from "react";
import { Typography, Box, Card } from "@material-ui/core";

const MyAccordian = (props) => {
  return (
    <>
      <div>
        <Box p={2}>
          <Card>
            <Typography>{props.question}</Typography>
            <Typography>{props.ans}</Typography>
          </Card>
        </Box>
      </div>
    </>
  );
};

export default MyAccordian;
